const e='{"head": [{"t": "h1", "c": "Antoine de Saint-Exup\xE9ry", "p": 0}, {"t": "h2", "c": "Le petit prince", "p": 1}], "body": [{"t": "h2", "c": "Chapitre XIII", "p": 277}, {"t": "text", "c": ["Et le petit prince s\u2019en fut, perplexe. \xAB Les grandes personnes sont d\xE9cid\xE9ment tr\xE8s tr\xE8s bizarres \xBB, se disait-il en luim\xEAme durant le voyage."], "p": 278}, {"t": "text", "c": ["La quatri\xE8me plan\xE8te \xE9tait celle du businessman.", "Cet homme \xE9tait si occup\xE9 qu\u2019il ne leva m\xEAme pas la t\xEAte \xE0 l\u2019arriv\xE9e du petit prince."], "p": 280}, {"t": "text", "c": ["- Bonjour, lui dit celui-ci.", "Votre cigarette est \xE9teinte."], "p": 281}, {"t": "text", "c": ["- Trois et deux font cinq.", "Cinq et sept douze.", "Douze et trois quinze.", "Bonjour.", "Quinze et sept vingt-deux.", "Vingt-deux et six vingt-huit.", "Pas le temps de la rallumer.", "Vingt-six et cinq trente et un.", "Ouf !", "\xC7a fait donc cinq cent un millions six cent vingt-deux mille sept cent trente et un."], "p": 282}, {"t": "text", "c": ["- Cinq cents millions de quoi ?"], "p": 283}, {"t": "text", "c": ["- Hein ? Tu es toujours l\xE0 ?", "Cinq cent un millions de\u2026 je ne sais plus\u2026", "J\u2019ai tellement de travail ! Je suis s\xE9rieux, moi, je ne m\u2019amuse pas \xE0 des balivernes !", "Deux et cinq sept\u2026", "- Cinq cent un millions de quoi ? r\xE9p\xE9ta le petit prince qui jamais de sa vie, n\u2019avait renonc\xE9 \xE0 une question, une fois qu\u2019il l\u2019avait pos\xE9e."], "p": 284}, {"t": "text", "c": ["Le businessman leva la t\xEAte :"], "p": 285}, {"t": "text", "c": ["- Depuis cinquante-quatre ans que j\u2019habite cette plan\xE8te-ci, je n\u2019ai \xE9t\xE9 d\xE9rang\xE9 que trois fois.", "La premi\xE8re fois \xE7\u2019a \xE9t\xE9, il y a vingt-deux ans, par un hanneton qui \xE9tait tomb\xE9 Dieu sait d\u2019o\xF9.", "Il r\xE9pandait un bruit \xE9pouvantable, et j\u2019ai fait quatre erreurs dans une addition.", "La seconde fois \xE7\u2019a \xE9t\xE9, il y a onze ans, par une crise de rhumatisme.", "Je manque d\u2019exercice.", "Je n\u2019ai pas le temps de fl\xE2ner. Je suis s\xE9rieux, moi. La troisi\xE8me fois\u2026 la voici !", "Je disais donc cinq cent un millions\u2026", "- Millions de quoi ?"], "p": 286}, {"t": "text", "c": ["Le businessman comprit qu\u2019il n\u2019\xE9tait point d\u2019espoir de paix :"], "p": 287}, {"t": "text", "c": ["- Millions de ces petites choses que l\u2019on voit quelquefois dans le ciel."], "p": 288}, {"t": "text", "c": ["- Des mouches ?"], "p": 289}, {"t": "text", "c": ["- Mais non, des petites choses qui brillent."], "p": 290}, {"t": "text", "c": ["- Des abeilles ?"], "p": 291}, {"t": "text", "c": ["- Mais non. Des petites choses dor\xE9es qui font r\xEAvasser les fain\xE9ants.", "Mais je suis s\xE9rieux, moi ! Je n\u2019ai pas le temps de r\xEAvasser."], "p": 292}, {"t": "text", "c": ["- Ah !"], "p": 293}, {"t": "text", "c": ["Des \xE9toiles ? - C\u2019est bien \xE7a."], "p": 294}, {"t": "text", "c": ["Des \xE9toiles. - Et que fais-tu de cinq cents millions d\u2019\xE9toiles ?"], "p": 295}, {"t": "text", "c": ["- Cinq cent un millions six cent vingt-deux mille sept cent trente et un.", "Je suis s\xE9rieux, moi, je suis pr\xE9cis."], "p": 296}, {"t": "text", "c": ["- Et que fais-tu de ces \xE9toiles ?"], "p": 297}, {"t": "text", "c": ["- Ce que j\u2019en fais ?"], "p": 298}, {"t": "text", "c": ["- Oui."], "p": 299}, {"t": "text", "c": ["- Rien. Je les poss\xE8de."], "p": 300}, {"t": "text", "c": ["- Tu poss\xE8des les \xE9toiles ? - Oui."], "p": 302}, {"t": "text", "c": ["- Mais j\u2019ai d\xE9j\xE0 vu un roi qui\u2026", "- Les rois ne poss\xE8dent pas.", "Ils \xAB r\xE8gnent \xBB sur.", "C\u2019est tr\xE8s diff\xE9rent."], "p": 303}, {"t": "text", "c": ["- Et \xE0 quoi cela te sert-il de poss\xE9der les \xE9toiles ?"], "p": 304}, {"t": "text", "c": ["- \xC7a me sert \xE0 \xEAtre riche."], "p": 305}, {"t": "text", "c": ["- Et \xE0 quoi cela te sert-il d\u2019\xEAtre riche ?"], "p": 306}, {"t": "text", "c": ["- \xC0 acheter d\u2019autres \xE9toiles, si quelqu\u2019un en trouve."], "p": 307}, {"t": "text", "c": ["\xAB Celui-l\xE0, se dit en lui-m\xEAme le petit prince, il raisonne un peu comme mon ivrogne. \xBB"], "p": 308}, {"t": "text", "c": ["Cependant il posa encore des questions :"], "p": 309}, {"t": "text", "c": ["- Comment peut-on poss\xE9der les \xE9toiles ?"], "p": 310}, {"t": "text", "c": ["- \xC0 qui sont-elles ? Riposta, grincheux, le businessman."], "p": 311}, {"t": "text", "c": ["- Je ne sais pas.", "\xC0 personne."], "p": 312}, {"t": "text", "c": ["- Alors elles sont \xE0 moi, car j\u2019y ai pens\xE9 le premier."], "p": 313}, {"t": "text", "c": ["- \xC7a suffit ?"], "p": 314}, {"t": "text", "c": ["- Bien s\xFBr.", "Quand tu trouves un diamant qui n\u2019est \xE0 personne, il est \xE0 toi. Quand tu trouves une \xEEle qui n\u2019est \xE0 personne, elle est \xE0 toi. Quand tu as une id\xE9e le premier, tu la fais breveter : elle est \xE0 toi.", "Et moi je poss\xE8de les \xE9toiles, puisque jamais personne avant moi n\u2019a song\xE9 \xE0 les poss\xE9der."], "p": 315}, {"t": "text", "c": ["- \xC7a c\u2019est vrai, dit le petit prince.", "Et qu\u2019en fais-tu ?"], "p": 316}, {"t": "text", "c": ["- Je les g\xE8re.", "Je les compte et je les recompte, dit le businessman.", "C\u2019est difficile.", "Mais je suis un homme s\xE9rieux !"], "p": 317}, {"t": "text", "c": ["Le petit prince n\u2019\xE9tait pas satisfait encore."], "p": 318}, {"t": "text", "c": ["- Moi, si je poss\xE8de un foulard, je puis le mettre autour de mon cou et l\u2019emporter. Moi, si je poss\xE8de une fleur, je puis cueillir ma fleur et l\u2019emporter.", "Mais tu ne peux pas cueillir les \xE9toiles !"], "p": 319}, {"t": "text", "c": ["- Non, mais je puis les placer en banque."], "p": 320}, {"t": "text", "c": ["- Qu\u2019est-ce que \xE7a veut dire ?"], "p": 321}, {"t": "text", "c": ["- \xC7a veut dire que j\u2019\xE9cris sur un petit papier le nombre de mes \xE9toiles. Et puis j\u2019enferme \xE0 clef ce papier-l\xE0 dans un tiroir."], "p": 322}, {"t": "text", "c": ["- Et c\u2019est tout ?"], "p": 323}, {"t": "text", "c": ["- \xC7a suffit !"], "p": 324}, {"t": "text", "c": ["\xAB C\u2019est amusant, pensa le petit prince. C\u2019est assez po\xE9tique. Mais ce n\u2019est pas tr\xE8s s\xE9rieux. \xBB"], "p": 325}, {"t": "text", "c": ["Le petit prince avait sur les choses s\xE9rieuses des id\xE9es tr\xE8s diff\xE9rentes des id\xE9es des grandes personnes."], "p": 326}]}';export{e as default};
